public class Base64Load {

	/**
	 * 
	 * @MethodsDescription:
	 * @MethodName:phone
	 * @param portrait 文件流
	 * @Author:singleton-zw
	 * @Return:void
	 */
	public static void phone(String portrait){
		String imageName = System.currentTimeMillis() + ".jpg";
		if (portrait != null) {
			SaveImage.getFileFromBytes("D:",imageName, portrait);
		}
	}
	
	public static void main(String[] args) {
		//base64 字符流
		String g = "";
		Base64Load.phone(g);
	}
}
